$(document).ready(function(){

    $('.banner-slick-cara').slick({
      infinite: true,
      speed: 1000,
      autoplay: true,
      autoplaySpeed: 2000,
      arrows: false,
      dots: false,
      slidesToShow: 3,
      slidesToScroll: 1
    });

    $('.intro-slick-cara .slick-slide img').matchHeight();
    $('.products-show .product-list .img-wrap').matchHeight();
    $('.products-show .product-list .list-content').matchHeight();
    $('.team-member .team-pic .img-wrap').matchHeight();

    // handle links with @href started with '#' only
    $(document).on('click', 'a[href^="#"]', function(e) {
        // target element id
        var id = $(this).attr('href');
        if ($(this).hasClass('nav-link')) {
          return;
        }
        // target element
        var $id = $(id);
        if ($id.length === 0) {
            return;
        }
        
        // prevent standard hash navigation (avoid blinking in IE)
        e.preventDefault();
        
        // top position relative to the document
        var pos = $id.offset().top + 50;
        
        // animated top scrolling
        $('body, html').animate({scrollTop: pos});
    });

    /* Instantiating iziModal */
      /* Instantiating iziModal */
        $(".modal-custom").iziModal({
            overlayClose: false,
            overlayColor: 'rgba(0, 0, 0, 0.6)'
        });

        /* JS inside the modal */

        $(".modal-custom").on('click', '.login-box-body .change-log', function(event) {
            event.preventDefault();
            $(this).closest(".login-box-body").addClass("hide").siblings(".login-box-body").removeClass("hide");
            var fx = "wobble",  //wobble shake
                $modal = $(this).closest('.iziModal');

            if( !$modal.hasClass(fx) ){
                $modal.addClass(fx);
                setTimeout(function(){
                    $modal.removeClass(fx);
                }, 1500);
            }
        });

        $('.modal-custom .checkbox').click(function(){
            $(this).closest('.register-form').find('.new-address').toggleClass('hider');
        });

});